import React, { Component } from 'react';
import PropTypes from 'prop-types';
import "./Recipe.css";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import {Card, Button } from 'react-bootstrap';



class Recipe extends Component {


  render () {
    return(
      <div className="item-list_container">

        <Card style={{ width: '18rem' }}>
          <Card.Img variant="top" src={this.props.image} />
          <Card.Body>
            <Card.Title>{this.props.label}</Card.Title>
            <Card.Text>
              {this.props.user ?
                <button
                  onClick={() => this.props.addRecipeActionCallback()}
                  className="item__button">Add to Calendar</button> :
                  <p></p> }
                    <button  onClick={() => this.props.recipeDetailCallback()}>Recipe Details </button>
                  </Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>;


              <ul className="recipe-items">
                <li>{this.props.label}</li>
                <li><img src={this.props.image} alt=''/></li>
                <li>
                  {this.props.user ?
                    <button
                      onClick={() => this.props.addRecipeActionCallback()}
                      className="item__button">Add to Calendar</button> :
                      <p></p> }
                      </li>

                      <li><button  onClick={() => this.props.recipeDetailCallback()}>Recipe Details </button></li>
                    </ul>





                  </div>
                )
              }

            }
            Recipe.propTypes = {
              label: PropTypes.string

            };


            export default Recipe;
